import React from 'react';

class Result extends React.Component {
    constructor(props) {
        super(props);
        this.forceUpdate();
        console.log('result:', props.data);
        this.data = props.data;
    }

    handleData(items) {
        let ser = 0;
        let res = [], temp = [];
        for (let i of items) {
            if (ser % 3 === 0) {
                res.push(<tr>{[...temp]}</tr>);
                temp = []; ser = 0;
            }
            temp.push(<td>{i}</td>);
            ser++;
        }
        return res;
    }

    render() {
        return (<div className='result'>
            <h1 className='title'>
                结果
            </h1>
            {}
            <img src={require('./image/1.png')} />
        </div>);
    }
}

export default Result;
